import React, { useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './pages/HomePage/HomePageComp/Home'
import About from './pages/AboutPage/AboutPageComp/About'
import Header from './components/Header';
import Footer from './components/Footer';
import WorlTradeCenter from './pages/PortfolioPage/WorlTradeCenterComp/WorlTradeCenter'
import ChurchGateTower1 from './pages/PortfolioPage/ChurchgateTower1/ChurchGateTower1';
import TourForm from './pages/HomePage/HomePageComp/TourForm';
import WhyChooseUs from './pages/WhyChooseUsPage/WhyChooseUs';
import ContactUs from './pages/ContactPage/ContactUs';
import ChurchGateTower2 from './pages/PortfolioPage/ChurchgateTower2/ChurchGateTower2';
import AOS from 'aos';
import 'aos/dist/aos.css';

const App = () => {

   useEffect(() => {
    AOS.init({
      duration: 1000,  // Animation duration in ms
      once: true       // Animate only once
    });
  }, []);

  return (
    <div>
      <Router>
        <Header /> 
      <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/about" element={<About />} />
      <Route path="/worldtradecenter" element={<WorlTradeCenter />} />
    <Route path="/tower1" element={<ChurchGateTower1 />} />
    <Route path="/tower2" element={<ChurchGateTower2 />} />
    {/* <Route path="/plaza" element={<Plaza />} /> */}
    {/* <Route path="/warehouses" element={<Warehouses />} /> */}
    {/* <Route path="/terrace" element={<Terrace />} /> */}
      <Route path="/contact" element={<ContactUs />} />
      <Route path="/whychooseUs" element={ <WhyChooseUs /> } />
      </Routes>
      <TourForm />
      <Footer />
      </Router>
    </div>
  )
}

export default App
